apiVersion: operators.coreos.com/v1alpha1
kind: ClusterServiceVersion
metadata:
  annotations:
    alm-examples: |-
      [
        {
          "apiVersion": "redhatcop.redhat.io/v1alpha1",
          "kind": "MustGather",
          "metadata": {
            "name": "example-mustgather"
          },
          "spec": {
            "caseID": "02527285",
            "caseManagementAccountSecretRef": {
              "name": "case-management-creds"
            }
          }
        },
        {
          "apiVersion": "redhatcop.redhat.io/v1alpha1",
          "kind": "MustGather",
          "metadata": {
            "name": "full-mustgather"
          },
          "spec": {
            "caseID": "02527285",
            "caseManagementAccountSecretRef": {
              "name": "case-management-creds"
            },
            "serviceAccountRef": {
              "name": "must-gather-admin"
            },
            "mustGatherImages": [
              "quay.io/kubevirt/must-gather:latest",
              "quay.io/ocs-dev/ocs-must-gather"
            ]
          }
        }
      ]
    capabilities: Deep Insights
    categories: Security, Monitoring
    certified: "false"
    containerImage: quay.io/redhat-cop/must-gather-operator:latest
    createdAt: 11/14/2019
    description:
      This operator provides a facility to easily upload must-gather reports
      to a Red Hat case.
    repository: https://github.com/redhat-cop/must-gather-operator
    support: Best Effort
  name: must-gather-operator.v0.1.1
  namespace: placeholder
spec:
  apiservicedefinitions: {}
  customresourcedefinitions:
    owned:
      - description:
          represents the request to collect must-gather information and upload
          it to the specified case
        displayName: Must Gather
        kind: MustGather
        name: mustgathers.redhatcop.redhat.io
        version: v1alpha1
  description: |-
    The must gather operator helps collecting must gather information on a cluster and uploading it to a case.
    To use the operator a cluster administrator can create the following must gather CR:

    ```yaml
    apiVersion: redhatcop.redhat.io/v1alpha1
    kind: MustGather
    metadata:
      name: example-mustgather
    spec:
      caseID: '02527285'
      caseManagementAccountSecretRef:
        name: case-management-creds
    ```

    this request will collect the standard must gather info and upload it to case `#02527285` using the credentials found in the `caseManagementCreds` secret.

    A more complex example:

    ```yaml
    apiVersion: redhatcop.redhat.io/v1alpha1
    kind: MustGather
    metadata:
      name: full-mustgather
    spec:
      caseID: '02527285'
      caseManagementAccountSecretRef:
        name: case-management-creds
      serviceAccountRef:
        name: must-gather-admin
      mustGatherImages:
      - quay.io/kubevirt/must-gather:latest
      - quay.io/ocs-dev/ocs-must-gather
    ```

    in this example we are using a specific service account (which must have cluster admin permissions as per must-gather requirements) and we are specifying a couple of additional must gather images to be run for the `kubevirt` and `ocs` subsystem. If not specified serviceAccountRef.Name will default to `default`. Also the standard must gather image: `quay.io/openshift/origin-must-gather:latest` is always added by default.
  displayName: Must Gather Operator
  icon:
    - base64data: 
      mediatype: image/png
  install:
    spec:
      deployments:
        - name: must-gather-operator
          spec:
            replicas: 1
            selector:
              matchLabels:
                name: must-gather-operator
            strategy: {}
            template:
              metadata:
                labels:
                  name: must-gather-operator
              spec:
                containers:
                  - command:
                      - must-gather-operator
                    env:
                      - name: WATCH_NAMESPACE
                        valueFrom:
                          fieldRef:
                            fieldPath: metadata.annotations['olm.targetNamespaces']
                      - name: POD_NAME
                        valueFrom:
                          fieldRef:
                            fieldPath: metadata.name
                      - name: OPERATOR_NAME
                        value: must-gather-operator
                    image: quay.io/redhat-cop/must-gather-operator:v0.1.1
                    imagePullPolicy: Always
                    name: must-gather-operator
                    resources: {}
                serviceAccountName: must-gather-operator
      permissions:
        - rules:
            - apiGroups:
                - ""
              resources:
                - configmaps
                - pods
              verbs:
                - "*"
            - apiGroups:
                - ""
              resources:
                - services
                - services/finalizers
              verbs:
                - "*"
            - apiGroups:
                - apps
              resources:
                - replicasets
                - deployments
              verbs:
                - get
                - list
            - apiGroups:
                - monitoring.coreos.com
              resources:
                - servicemonitors
              verbs:
                - get
                - create
            - apiGroups:
                - apps
              resourceNames:
                - must-gather-operator
              resources:
                - deployments/finalizers
              verbs:
                - update
            - apiGroups:
                - redhatcop.redhat.io
              resources:
                - mustgathers
                - mustgathers/finalizers
                - mustgathers/status
              verbs:
                - "*"
            - apiGroups:
                - batch
              resources:
                - jobs
              verbs:
                - "*"
            - apiGroups:
                - ""
              resources:
                - events
              verbs:
                - "*"
            - apiGroups:
                - ""
              resources:
                - secrets
              verbs:
                - get
                - list
                - watch
            - apiGroups:
                - config.openshift.io
              resourceNames:
                - cluster
              resources:
                - proxies
              verbs:
                - get
                - list
          serviceAccountName: must-gather-operator
    strategy: deployment
  installModes:
    - supported: true
      type: OwnNamespace
    - supported: true
      type: SingleNamespace
    - supported: false
      type: MultiNamespace
    - supported: false
      type: AllNamespaces
  keywords:
    - case_management
    - support
    - must_gather
  links:
    - name: repository
      url: https://github.com/redhat-cop/must-gather-operator
    - name: conatinerImage
      url: https://quay.io/redhat-cop/must-gather-operator:latest
  maintainers:
    - email: rspazzol@redhat.com
      name: Raffaele Spazzoli
  maturity: alpha
  provider:
    name: Containers & PaaS CoP
  replaces: must-gather-operator.v0.1.0
  version: 0.1.1
